\Rightarrow\qquad a &= \frac{y-1}{y} \\
\Rightarrow\qquad y &= \frac{1}{1-a} \\
\Rightarrow\qquad f^{-1}(a) &= \frac{1}{1-a}
\end{align*}

Now that we have the inverse function, we can find the product $f^{-1}(a) \times a \times f(a)$.

\begin{align*}
