\boxed{\text{To solve for } n, we need to simplify the equation.}

\text{First, we can rewrite the equation as:}
\begin{align*}
2(n+1)!+6n!&=3(n+1)!\\
2(n+1)!-3(n+1)!&=-6n!\\
-(n+1)!&=-6n!
\end{align*}

\text{Now, we can divide both sides by $-(n+1)!$ to get:}
\begin{align*}
\frac{-(n+1)!}{-(n+1)!}&=\frac{-6n!}{-(n+1)!}\\
1&=\frac{6n!}{(n+1)!}
\end{align*}

\text{We can simplify the right side of the equation by cancelling out the $n!$ terms:}
\begin{align*}
1&=\frac{6n!}{(n+1)n!}\\
1&=\frac{6}{n+1}
\end{align*}

\text{Now, we can multiply both sides by $n+1$ to get:}
\begin{align*}
1(n+1)&=6\\
n+1&=6
\end{align*}

\text{Finally, we can subtract 1 from both sides to solve for $n$:}
\begin{align*}
n+1-1&=6-1\\
n&=5
\end{align*}

