To find the distance from the origin to the plane, we need to find the equation of the plane first. 

The equation of a plane passing through three points $(x_1, y_1, z_1), (x_2, y_2, z_2),$ and $(x_3, y_3, z_3)$ is given by:

\begin{align*}
\begin{vmatrix}
x-x_1 & y-y_1 & z-z_1\\
x_2-x_1 & y_2-y_1 & z_2-z_1\\
x_3-x_1 & y_3-y_1 & z_3-z_1
\end{vmatrix} &= 0
\end{align*}

Substituting the given points $(-5,0,0),$ $(0,2,0),$ and $(0,0,-7)$ into the equation, we get:

\begin{align*}
\begin{vmatrix}
x+5 & y & z\\
5 & 2 & 0\\
0 & 0 & -7
\end{vmatrix} &= 0\\
(x+5)(-14) - (2)(0) - (5)(0) &= 0\\
-14x - 35 &= 0\\
x &= -\frac{35}{14}\\
x &= -\frac{5}{2}
\end{align*}

The equation of the plane is $x = -\frac{5}{2}$. However, this is not the equation of a plane in the standard form $ax + by + cz + d = 0$. We need to find the equation of the plane in the standard form.

The equation of a plane passing through a point $(x_1, y_1, z_1)$ with normal vector $(a, b, c)$ is given by:

\begin{align*}
a(x-x_1) + b(y-y_1) + c(z-z_1) &= 0
\end{align*}

We can find the normal vector $(a, b, c)$ by taking the cross product of the vectors $\overrightarrow{AB}$ and $\overrightarrow{AC}$, where $A = (-5,0,0), B = (0,2,0),$ and $C = (0,0,-7)$.

\begin{align*}
\overrightarrow{AB} &= (0-(-5), 2-0, 0-0) = (5, 2, 0)\\
\overrightarrow{AC} &= (0-(-5), 0-0, -7-0) = (5, 0, -7)
\end{align*}

The cross product of $\overrightarrow{AB}$ and $\overrightarrow{AC}$ is:

\begin{align*}
\begin{vmatrix}
\mathbf{i} & \mathbf{j} & \mathbf{k}\\
5 & 2 & 0\\
5 & 0 & -7
\end{vmatrix} &= (2)(-7) - (0)(0)\mathbf{i} - (5)(0) + (5)(2)\mathbf{j} + (5)(0) - (2)(5)\mathbf{k}\\
&= -14\mathbf{i} + 10\mathbf{j} - 10\mathbf{k}
\end{align*}

The normal vector is $(-14, 10, -10)$. The equation of the plane is:

\begin{align*}
-14(x+5) + 10(y) - 10(z) &= 0\\
-14x - 70 + 10y - 10z &= 0\\
-14x + 10y - 10z + 70 &= 0
\end{align*}

The equation of the plane is $-14x + 10y - 10z + 70 = 0$.

