To convert polar coordinates to rectangular coordinates, we use the formulas:

$x = r \cos \theta$
$y = r \sin \theta$

In this case, $r = 10$ and $\theta = \frac{\pi}{4}$.

\begin{align*}
x & = 10 \cos \left( \frac{\pi}{4} \right) \\
& = 10 \cdot \frac{1}{\sqrt{2}} \\
& = \frac{10}{\sqrt{2}} \\
& = \frac{10 \sqrt{2}}{2}
\end{align*}

\begin{align*}
