& = 10 \cdot \frac{1}{\sqrt{2}} \\
& = \frac{10}{\sqrt{2}} \\
& = \frac{10 \sqrt{2}}{2}
\end{align*}

\boxed{\left( \frac{10 \sqrt{2}}{2}, \frac{10 \sqrt{2}}{2} \right)}

