\text{To find the values of }x\text{ for which }\mathbf{A} - x \mathbf{I}\text{ is not invertible, we need to find the values of }x\text{ for which the determinant of }\mathbf{A} - x \mathbf{I}\text{ is zero.}\\
\text{The matrix }\mathbf{A} - x \mathbf{I}\text{ is given by}\\
\mathbf{A} - x \mathbf{I} = \begin{pmatrix} 1 & 5 \\ 1 & 3 \end{pmatrix} - x \begin{pmatrix} 1 & 0 \\ 0 & 1 \end{pmatrix} = \begin{pmatrix} 1 - x & 5 \\ 1 & 3 - x \end{pmatrix}.
\end{array}
\begin{array}{c}
\text{The determinant of }\mathbf{A} - x \mathbf{I}\text{ is given by}\\
\det(\mathbf{A} - x \mathbf{I}) = (1 - x)(3 - x) - (5)(1)\\
= 3 - 4x + x^2 - 5\\
= x^2 - 4x - 2.
\end{array}
\begin{array}{c}
\text{To find the values of }x\text{ for which }\det(\mathbf{A} - x \mathbf{I}) = 0, \text{ we need to solve the equation }x^2 - 4x - 2 = 0.
\end{array}
\begin{array}{c}
\text{We can solve this quadratic equation by factoring.}\\
x^2 - 4x - 2 = (x - 2)(x + 1) = 0.
\end{array}
\begin{array}{c}
\text{Therefore, the solutions to the equation are }x = 2\text{ and }x = -1.
\end{array}
\boxed{2, -1}}

