To convert the point from cylindrical coordinates to rectangular coordinates, we need to use the following formulas:

\begin{align*}
x &= r \cos \theta \\
y &= r \sin \theta \\
z &= z
\end{align*}

Given the point $\left( 6 \sqrt{3}, \frac{5 \pi}{3}, -2 \right)$, we can plug in the values into the formulas:

\begin{align*}
x &= 6 \sqrt{3} \cos \left( \frac{5 \pi}{3} \right) \\
y &= 6 \sqrt{3} \sin \left( \frac{5 \pi}{3} \right) \\
z &= -2
\end{align*}

Using a calculator or trigonometric identities, we can evaluate the cosine and sine of $\frac{5 \pi}{3}$:

\begin{align*}
\cos \left( \frac{5 \pi}{3} \right) &= \cos \left( 2 \pi - \frac{\pi}{3} \right) \\
&= \cos \left( \frac{\pi}{3} \right) \\
&= \frac{1}{2}
\end{align*}

\begin{align*}
\sin \left( \frac{5 \pi}{3} \right) &= \sin \left( 2 \pi - \frac{\pi}{3} \right) \\
&= -\sin \left( \frac{\pi}{3} \right) \\
&= -\frac{\sqrt{3}}{2}
\end{align*}

Now we can plug these values back into the formulas:

\begin{align*}
x &= 6 \sqrt{3} \cdot \frac{1}{2} \\
&= 3 \sqrt{3} \\
y &= 6 \sqrt{3} \cdot -\frac{\sqrt{3}}{2} \\
&= -9 \\
z &= -2
\end{align*}

So the rectangular coordinates of the point are $\boxed{(3 \sqrt{3}, -9, -2)}$.

